import React from "react";
import ReactDom from "react-dom";

const fName = "Vishal";
const lName = "lohemor";
const toDayDate = new Date().toLocaleDateString();
const currTime = new Date().toLocaleTimeString();
// const currentDate = `${toDayDate.getDate()}/${toDayDate.getMonth()}/${toDayDate.getFullYear()}`;
// const currTime = `${toDayDate.getHours()}:${toDayDate.getMinutes()}:${toDayDate.getSeconds()}`; // => 9

let amPM = () => {
  let amPmStd = "";
  if (toDayDate.getHours() > 12) {
    amPmStd = "PM";
  } else {
    amPmStd = "AM";
  }
  return amPmStd;
};

ReactDom.render(
  <>
    <h1>{`My name is ${fName} ${lName}`}</h1>
    <p>{`Today date is : ${toDayDate}`}</p>
    <p>{`Current time is : ${currTime} ${amPM()}`}</p>
  </>,
  document.getElementById("root")
);
